import Link from 'next/link';
import 'bootstrap/dist/css/bootstrap.min.css';

const linkStyle = {
    marginRight: 15
}

const Menu = () => {
    return (
        <div>
            <Link href="/" >
                <a style={linkStyle}>Home</a>
            </Link>
            <Link href="/sobre" >
                <a style={linkStyle}>Sobre a Empresa</a>
            </Link>
            <Link href="/contato" >
                <a style={linkStyle}>Contato</a>
            </Link>
        </div>
    )
}

export default Menu
